import LoginForm from "./myProject/loginform.js";
import SignForm from "./myProject/siginin.js";
import './App.css'

function App() {
  return (
    <div className="page">
      <BrowserRouter>
      <Routes>
        <Route path="/loginform" element=<LoginForm/> ></Route>
        <Route path="/signform" element=<SignForm/> ></Route>
      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
